options.method = "POST";
options.body = getBody(swneBoundingBox);

return apogee.net.jsonRequest(url,options);

updateData.supplementalCode:
function getBody(boundingBoxArray) {
    var bboxString = boundingBoxArray.join(",");

    var query = "[out:json];"
    query += "("
    query += "node(" + bboxString + ");";
    query += "(";
    query += "way(" + bboxString + ");";
    query += ">;"
    query += ");"
    query += ");"
    query += "out;";

    return query;
}

updateData.functionBody:
var output = [];

for(var i =0 ; i < osmDownload.elements.length; i++) {
    var element = osmDownload.elements[i];

    //only save features that have properties
    if(element.tags === undefined) continue;

    //process the different feature types
    var feature = {};
    feature.id = element.id;
    feature.type = element.type;
    feature.tags = element.tags;

    switch(element.type) {
        case "node":
            feature.coords = getNodePoint(element.id);
            break;

        case "way":
            feature.coords = getNodePointList(element.nodes);
            break;

        case "relation": 
            //we will ignore these
            feature.coords = null;
            break;

        default:
            //we will handle this later if we have to deal with it
            throw new Error("Unexpected osm type: " + element.type);
    }

    //only sve things that have geometry
    if(feature.coords) { 
        output.push(feature)
    }

}

return output;

var output = {};

for(var i =0 ; i < osmDownload.elements.length; i++) {
    var element = osmDownload.elements[i];

    if(element.type == "node") {
        output[element.id] = [element.lon,element.lat];
    }
}

return output;

var output = {};
output.type = "FeatureCollection";
output.properties = {};
output.features = rawFeatures.map((rawFeature) => createFeature(rawFeature));
return output;

updateData.supplementalCode:
function createFeature(rawFeature) {
    var feature = {};
    feature.type = "Feature";
    feature.properties = rawFeature.tags;
    feature.geometry = getGeometry(rawFeature);
    return feature;
}

function getGeometry(rawFeature) {
    var coords;
    var type;
    switch(rawFeature.type) {
        case "node":
            type = "Point";
            coords = getGeojsonPoint(rawFeature.coords);
            break;

        case "way":
            //later - choose polygon or linestring
            type = "LineString";
            coords = getGeojsonLineString(rawFeature.coords);
            break;

        default:
            throw new Error("Unexpected osm type!");
    }

    return {
        "type": type,
        "coordinates": coords
    }
}

function getGeojsonPoint(coords) {
    return coords;
}

function getGeojsonLineString(coords) {
    return coords;
}

