var data = {};
data.geoJson = geoJson;
data.options = getOptions();
data.bounds= getLeafletBounds(swneBoundingBox);

return data;

updateData.supplementalCode:
function getOptions() {

    //common style for lines and polygons
    var wayStyleInfo = {
        "color": "black",
        "weight": 2
    };
    var emptyStyleInfo = {
    };

    //common style for points
    var pointStyleInfo = {
        "radius": 8,
        "color": "red",
        "weight": 1,
        "opacity": 1,
        "fillColor": "blue",
        "fillOpacity": 0.8
    }

    var options = {};
    options.style = function(feature) {

        for(var key in theme.wayStyleTable) {
            var keyEntry = theme.wayStyleTable[key];
            var value = feature.properties[key];
            var styleInfo = undefined;

            if(value !== undefined) {
                if(keyEntry.values) {
                    styleInfo = keyEntry.values[value];
                }
                if(styleInfo === undefined) {
                    styleInfo = keyEntry.styleInfo;
                }

                if(styleInfo !== undefined) return styleInfo;
            }
        }
        return emptyStyleInfo;
    };

    options.pointToLayer = function(feature,latLng) {
        return  L.circleMarker(latLng, pointStyleInfo);
    };

    return options;   
}

function getLeafletBounds(swneBoundingBox) {
    var bottomRight = L.latLng(swneBoundingBox[0], swneBoundingBox[1]);
    var topLeft = L.latLng(swneBoundingBox[2], swneBoundingBox[3]);
    return L.latLngBounds(bottomRight, topLeft);
}

updateData.functionBody:
var output = [];

//header row
output.push(columns);

for(var key in tags) {
    var keyEntry = tags[key];
    for(var value in keyEntry) {
        var valueRow = [key,value,keyEntry[value]];
        output.push(valueRow);
    }
    var keyRow = [key];
    output.push(keyRow)
}

return output;

var tagMap = {};

for(var i = 0; i < rawFeatures.length; i++) {
    var feature = rawFeatures[i];
    var properties = feature.tags;

    for(var key in properties) {
        var keyEntry = tagMap[key];
        if(!keyEntry) {
            keyEntry = {};
            tagMap[key] = keyEntry;
        }

        var value = properties[key];
        if(keyEntry[value] === undefined) {
            keyEntry[value] = 1;
        }
        else {
            keyEntry[value]++;
        }
    }
}

return tagMap;

var table = {};

//don't include header row
for(var i = 1; i < themeInput.length; i++) {
    var row = themeInput[i];

    var styleInfo = createStyleInfo(row);
    if(styleInfo) {
        var key = getRowEntry(row,"Key");
        var value = getRowEntry(row,"Value");

        //get key entry
        var keyEntry = table[key];
        if(keyEntry === undefined) {
            var keyEntry = {};
            table[key] = keyEntry;
        }

        //add style to key or value 
        if(value != "") {
            if(keyEntry.values === undefined) {
                keyEntry.values = {};
            }
            keyEntry.values[value] = styleInfo; 
        }
        else {
            keyEntry.styleInfo = styleInfo;
        }
    }
}

return table;

updateData.supplementalCode:
function getRowEntry(row,columnName) {
    var columnIndex = columnIndexMap[columnName];
    if(columnIndex === undefined) {
        throw new Error("Unknown theme column: " + columnName);
    }

    return row[columnIndex];

}

function createStyleInfo(row) {
    var fillColor = getRowEntry(row,"Fill Color");
    var strokeColor = getRowEntry(row,"Stroke Color");
    var strokeWeight = getRowEntry(row,"Stroke Weight");

    var styleInfo = {};
    var entryAdded = false;

    if(fillColor != "") {
        styleInfo.fillColor == fillColor;
        entryAdded = true;
    }
    if(strokeColor != "") {
        styleInfo.color = strokeColor;
        if(strokeWeight != "") {
            styleInfo.weight = strokeWeight;
        }
        entryAdded = true;
    }

    if(entryAdded) {
        return styleInfo;
    }
    else {
        return null;
    }
    }

